import React from "react";

export default function InfoTooltip({ state, onClose }) {
  console.log(state)
  
  return (
    <section

      className={`popup popup_infotooltip ${
        state !== "" ? "popup_opened" : ""
      }`}
      onClick={onClose}
    >
      <div className="info popup__container_infotooltip">
        <img
          className="popup__img_infotooltip"
          src=""
          alt={111}
          onClick={(e) => e.stopPropagation()}
        />
        <figcaption className="popup__caption_infotooltip">
          {state === "ok"
            ? "Вы успешно зарегистрировались"
            : "Что-то пошло не так! Попробуйте еще раз"}
        </figcaption>
        <button
          type="button"
          className="popup__close popup__close_photo"
          onClick={onClose}
        />
      </div>
    </section>
  );
}
